INSERT INTO `rb_sehensw` VALUES (1,1,'Kölner Dom','Kölner Dom','koelner_dom.jpg','Domkloster 4, 50667 Köln','Der K&ouml;lner Dom, sein Weihename ist St. Peter und Maria, ist mit 157 Metern H&ouml;he nach dem Ulmer M&uuml;nster die zweith&ouml;chste Kirche in Deutschland sowie die dritth&ouml;chste der Welt. Er ist zudem die popul&auml;rste Sehensw&uuml;rdigkeit Deutschlands, 2004 wurden etwa sechs Millionen Besucher aus aller Welt gez&auml;hlt (dies entspricht etwa den Zahlen des Eiffelturms).<br />\r\nDer Dom gilt als die gr&ouml;&szlig;te gotische Kathedrale &uuml;berhaupt und viele Kunsthistoriker sehen in ihm eine einmalige Harmonisierung s&auml;mtlicher Bauelemente und des Schmuckwerks im Stil der mittelalterlich-gotischen Architektur verwirklicht. Aus diesem Grund wurde der K&ouml;lner Dom 1996 in das Weltkulturerbe aufgenommen. Die atemberaubend gro&szlig;e Fl&auml;che der Westfassade mitsamt den beiden T&uuml;rmen von &uuml;ber 7000 Quadratmetern ist bis heute nirgendwo &uuml;bertroffen worden.<br />\r\nDas Motiv zum Bau des Doms datiert im Jahre 1164. Damals brachte der K&ouml;lner Erzbischof Rainald von Dassel die Reliquien der Heiligen Drei K&ouml;nige von Mailand nach K&ouml;ln. Sie waren ein Geschenk des Kaisers Friedrich I. Diese Reliquien f&uuml;hrten um 1225 zu dem Plan, einen neuen Dom zu bauen.<br />\r\nDer gotische Bau wurde am 15. August 1248 nach einem Plan des Dombaumeisters Gerhard von Rile begonnen. An der Grundsteinlegung nahm auch Graf Adolf IV. von Berg teil. Die Weihe des Chors erfolgte im Jahr 1322. 1410 erreicht der S&uuml;dturm das zweite Geschoss. Um 1528 stellte man den Bau ein. &Uuml;ber 300 Jahre bestimmte der unfertige K&ouml;lner Dom mit dem Baukran auf dem unvollendeten S&uuml;dturm die Silhouette der Stadt.<br />\r\n1814 wird die eine H&auml;lfte des 4,05 m gro&szlig;en &uuml;berarbeiteten Fassadenplanes des 3. Nachfolgers Gerhards, Dombaumeister Johannes, von Georg Moller in Darmstadt wiederentdeckt, die andere 1816 von Sulpiz Boisserée in Paris. Um die Wende zum 19. Jahrhundert lenkten au&szlig;erdem Romantiker in ihrer Begeisterung f&uuml;r das Mittelalter das &ouml;ffentliche Interesse erneut auf den unvollendeten Dombau. Neben anderen war Sulpiz Boisserée die treibende Kraft f&uuml;r die Vollendung, so dass letztlich am 4. September 1842 durch den preu&szlig;ischen K&ouml;nig Friedrich Wilhelm IV. und den Erzbischof Johannes von Geissel der Grundstein f&uuml;r den Weiterbau des K&ouml;lner Doms gelegt werden konnte. &quot; ... Hier, wo der Grundstein liegt, dort mit jenen T&uuml;rmen zugleich, sollen sich die sch&ouml;nsten Tore der ganzen Welt erheben ...&quot;.<br />\r\nAm 15. Oktober 1880 kann der Dom nach &uuml;ber 600 Jahren vollendet werden, getreu den Pl&auml;nen der K&ouml;lner Dombaumeister des Mittelalters und dem erhaltenen Fassadenplan aus der Zeit um 1310. Dabei wurden die modernsten Techniken, insbesondere f&uuml;r den Dachbau - eine neuzeitliche Eisenkonstruktion - durch die Dombaumeister Ernst Friedrich Zwirner und Voigtel eingesetzt. Nach der Fertigstellung war der Dom acht Jahre lang mit 156,5m das h&ouml;chste Geb&auml;ude der Welt. Die verbaute Steinmasse sind ca. 300.000 t.<br />\r\nGr&ouml;&szlig;ere Sch&auml;den erlitt der Dom w&auml;hrend des 2. Weltkrieges u.a. durch 14 Bombentreffer. Brandbomben wurden von Mitarbeitern die im und auf dem Dom postiert waren, sofort gel&ouml;scht. Durch die Bombentreffer st&uuml;rzten, unteranderem im Langhaus, einige Deckengew&ouml;lbe ein, das Dach ist dank des eisernen Dachstuhls nicht eingest&uuml;rzt.<br />\r\nAb 1956 konnte er seine Funktion f&uuml;r die Menschen wieder erf&uuml;llen.'),(2,2,'Eiffelturm','Tour Eiffel','eiffelturm.jpg','Champs de Mars, 75007 Paris','Der Eiffelturm (frz.: Tour Eiffel) ist das wohl bekannteste Wahrzeichen in Paris und steht weltweit als Symbol f&uuml;r Frankreich. Der Stahlfachwerkturm ist nach seinem Erbauer Alexandre Gustave Eiffel benannt. Er ist eine der gr&ouml;&szlig;ten Touristenattraktionen mit mehr als 6 Millionen Besuchern j&auml;hrlich. Im Jahr 2002 wurde der insgesamt 200-millionste Besucher empfangen.<br />\r\nDer Turm wurde zwischen 1887 und 1889 von Eiffels Firma, der Gustave Eiffel &amp; Cie, f&uuml;r die Weltausstellung anl&auml;sslich des hundertj&auml;hrigen Jubil&auml;ums der Franz&ouml;sischen Revolution erbaut. Gustave Eiffel war jedoch nicht der Architekt des Turms, sondern Stephen Sauvestre, der den Turm im Auftrag des Schweizers Maurice Koechlin konzipierte. Dieser hatte mit seinem Kollegen Emile Nouguier zusammen die Idee und fertigte die ersten Entw&uuml;rfe. Die Baukosten des Eiffelturms beliefen sich exakt auf 7.739.401 Francs und 31 Centimes und waren damit etwa eine Million Francs h&ouml;her als von Gustave Eiffel prognostiziert. In den letzten f&uuml;nf Monaten des Er&ouml;ffnungsjahres 1889 besuchten jedoch 1,9 Millionen Menschen die neue Attraktion so dass bis Ende des Jahres bereits drei Viertel der Gesamtkosten eingenommen waren. Damit wurde der Eiffelturm zu einem gewinntr&auml;chtigen Unternehmen.'),(3,4,'Kolosseum','Colosseo','colosseum.jpg','Piazza del Colosseo, 00184 Roma','Das Kolosseum (antiker Name: Amphitheatrum Novum oder Amphitheatrum Flavium) ist das gr&ouml;&szlig;te der im antiken Rom erbauten Amphitheater und der gr&ouml;&szlig;te geschlossene Bau der r&ouml;mischen Antike &uuml;berhaupt. Das Wahrzeichen der Stadt ist zugleich ein Zeugnis f&uuml;r die hochstehende Baukunst der alten R&ouml;mer wie f&uuml;r ihre Freude an grausamer Unterhaltung.<br />\r\nBis zu ihrer Vernichtung w&auml;hrend des gro&szlig;en Brandes von Rom im Jahre 64 stand auf dem Marsfeld eine aus Holz konstruierte Arena f&uuml;r Gladiatorenk&auml;mpfe, die Kaiser Nero gestiftet hatte. Sie d&uuml;rfte sich nicht wesentlich von den Amphitheatern au&szlig;erhalb Roms unterschieden haben. Nach dem Brand errichtete Nero am S&uuml;dhang des Oppius-H&uuml;gels eine neue Palastanlage, die Domus Aurea. Die G&auml;rten des &quot;Goldenen Hauses&quot; umfassten auch den sp&auml;teren Standort des Kolosseums in der Talsenke zwischen den H&uuml;geln Oppius und Palatin.<br />\r\nWenige Jahre nach Neros Sturz, um 72, gab sein Nachfolger Vespasian das Gebiet der &Ouml;ffentlichkeit zur&uuml;ck. Er lie&szlig; in wenigen Jahren ein Amphitheater errichten, das nicht nur Neros Vorg&auml;ngerbau auf dem Marsfeld, sondern alle bisherigen Arenen &uuml;bertreffen sollte. Nach einer neueren Rekonstruktion der Bauinschrift des Kolosseums wurde seine Errichtung aus der Beute des j&uuml;dischen Krieges, unter anderem mit dem gepl&uuml;nderten Goldschatz des Tempels von Jerusalem aus dem Jahr 70 finanziert.<br />\r\nDas Geb&auml;ude, das urspr&uuml;nglich dreigeschossig sein sollte, war beim Tod Vespasians 79 fast vollendet. Es bestand aus drei &uuml;bereinander angeordneten Arkadenreihen zu je 80 B&ouml;gen. Die Arkaden wurden durch Pilaster gegliedert; die zu ebener Erde im tuskanischem, einer Abwandlung des dorischen Stils, die des zweiten Geschosses im ionischen und die des dritten Geschosses im korinthischen Stil. Auf Wunsch von Vespasians Sohn Titus wurde den drei Rundbogengeschossen noch ein viertes Geschoss hinzugef&uuml;gt, das nicht von Arkaden durchbrochen, sondern massiv gestaltet und nur von rechteckigen Fensternischen durchbrochen wurde. Die Au&szlig;enmauern des Kolosseums wurden in Travertin ausgef&uuml;hrt, im Inneren wurden jedoch die billigeren Ziegel und Tuff verwendet.<br />\r\nNach seiner Fertigstellung im Jahr 80 wurde das Kolosseum nach der &Uuml;berlieferung des Cassius Dio mit hundertt&auml;gigen Spielen er&ouml;ffnet, unter anderem mit Gladiatorenk&auml;mpfen, nachgestellten Seeschlachten und Tierhetzen, bei denen 5.000 Tiere in der Arena get&ouml;tet worden sein sollen.'),(4,15,'Brandenburger Tor','Brandenburger Tor','brandenburger_tor.jpg','Pariser Platz, 10117 Berlin','Das Brandenburger Tor steht im Zentrum von Berlin und ist das wichtigste Wahrzeichen der Stadt. Das Bauwerk ist der Abschluss der Stra&szlig;e Unter den Linden. Hinter ihm beginnt der Tiergarten, den die Stra&szlig;e des 17. Juni durchquert. Viele wichtige Ereignisse in der Geschichte Berlins sind mit dem Brandenburger Tor als Staats- und Stadtsymbol verbunden.<br />\r\nDas Brandenburger Tor ist ein 26 m hoher, 65,5 m breiter und 11 m tiefer fr&uuml;hklassizistischer Sandsteinbau. Es erinnert an die Propyl&auml;en der Akropolis in Athen. Es hat f&uuml;nf Durchfahrten, von denen die mittlere etwas breiter ist, und zwei Torh&auml;user. Es wird durch 15 m hohe dorische S&auml;ulen gepr&auml;gt, die nach ionischer Art kanneliert sind und am Fu&szlig; einen Durchmesser von 1,75 m haben. Die Attika und die Innenseiten der Durchfahrten sind mit Reliefs bedeckt, die unter anderem Taten des Herkules, den r&ouml;mischen Kriegsgott Mars, der das Schwert in die Scheide steckt, und die G&ouml;ttin Minerva darstellen. Nach der Niederlegung der Stadtmauer 1867/68 f&uuml;gte der Schinkel-Sch&uuml;ler Johann Heinrich Strack 1868 dem Tor zu beiden Seiten die niedrigeren offenen S&auml;ulenhallen an.<br />\r\nDas Tor wird gekr&ouml;nt durch eine etwa 5 m hohe in Kupfer getriebene Skulptur, die Quadriga, die die gefl&uuml;gelte Siegesg&ouml;ttin darstellt, die einen von vier Pferden gezogenen Wagen in die Stadt hineinlenkt.<br />\r\nUrspr&uuml;nglich war das Brandenburger Tor ein Tor in der Zollmauer der Stadt Berlin und wurde 1734 errichtet. Von 1788 bis 1791 lie&szlig; der preu&szlig;ische K&ouml;nig Friedrich Wilhelm II. das Brandenburger Tor von Carl Gotthard Langhans im fr&uuml;hklassizistischen Stil neu errichten. Im Jahre 1793 wurde dem Brandenburger Tor die von Johann Gottfried Schadow gefertigte Quadriga zun&auml;chst mit der gefl&uuml;gelten Friedensg&ouml;ttin Eirene im Wagen aufgesetzt. 1806 wurde diese von Napoleon nach Paris verschleppt und sollte dort aufgestellt werden, doch bevor das geschah, wurde er entmachtet, und die Quadriga kehrte 1814 in Kisten verpackt nach Berlin zur&uuml;ck, wo sie zun&auml;chst restauriert wurde. Dabei wurde der von einem preu&szlig;ischen gekr&ouml;nten Adler besetzte Eichenkranz am Stab der G&ouml;ttin durch ein neues Machtsymbol, das Eiserne Kreuz, erg&auml;nzt, wodurch Schadows Friedensg&ouml;ttin zur Siegesg&ouml;ttin Victoria umgedeutet wurde. F&uuml;r die Berliner war die Quadriga nach ihrer R&uuml;ckf&uuml;hrung im Volksmund die Retourkutsche.');
